import React from "react";
import { facebook, imdb, instagram, soundCloud } from "../../images/image";
import styles from "./styles.module.css";

const SocialContainer = () => {
  const socials = [
    { icon: instagram, to: "https://www.instagram.com/melodious_harmony" },
    { icon: facebook, to: "https://www.facebook.com/jonathan.bartz" },
    { icon: imdb, to: "http://www.imdb.com/name/nm3247791" },
    { icon: soundCloud, to: "https://soundcloud.com/melodious_harmony" },
  ];

  return (
    <div className={styles.socialContainer}>
      {socials.map((el, i) => (
        <a
          key={i}
          href={el.to}
          target="_blank"
          rel="noreferrer"
          className={styles.socialIconLink}
        >
          <img
            src={el.icon}
            alt="#"
            className={styles.socialIcon}
          />
        </a>
      ))}
    </div>
  );
};

export default SocialContainer;
